  content: 'Hi, great work!


    However I don''t seem to be able to reproduce the results with diffusers following
    exactly

    ```

    from diffusers import StableDiffusionPipeline, DPMSolverMultistepScheduler

    import torch


    prompt = (

    "modelshoot style, (extremely detailed CG unity 8k wallpaper), full shot body
    photo of the most beautiful artwork in the world, "

    "english medieval witch, black silk vale, pale skin, black silk robe, black cat,
    necromancy magic, medieval era, "

    "photorealistic painting by Ed Blinkey, Atey Ghailan, Studio Ghibli, by Jeremy
    Mann, Greg Manchess, Antonio Moro, trending on ArtStation, "

    "trending on CGSociety, Intricate, High Detail, Sharp focus, dramatic, photorealistic
    painting art by midjourney and greg rutkowski"

    )


    model_id = "darkstorm2150/Protogen_v5.3_Official_Release"

    pipe = StableDiffusionPipeline.from_pretrained(model_id, torch_dtype=torch.float16)

    pipe.scheduler = DPMSolverMultistepScheduler.from_config(pipe.scheduler.config)

    pipe = pipe.to("cuda")


    image = pipe(prompt, num_inference_steps=25).images[0]


    image.save("./result.jpg")

    ```


    The results I have are a lot worse (same issue with other Protogen models too),
    for example:

    ![result1.jpg](https://cdn-uploads.huggingface.co/production/uploads/1675022951698-6303e75d3926de1f7ec3b212.jpeg)

    Any idea what could be the reason?


    Thanks!'
